import "./book.css"

function Booking() {

  const Booked=()=>{
    alert("ticket Booked")
  } 
  return <div>
    <SeactionA/>
    <hr/>
    <SeactionB/>
    <hr/>
    <SeactionC/>

    <button className="bookbtn" onClick={Booked}>Book & pay {}</button>
  </div>;
}

export default Booking;
